import Timer from "./components/Timer";

function App() {
  const time = new Date();
  time.setSeconds(time.getSeconds() + 59);

  return (
    <Container maxW="container.sm">
      <Timer expiryTimestamp={time} />
    </Container>
  );
}

export default App;
